import React from 'react'
import './css/Movement.css'

const Movement = (props) => {
    return (
        <div className='movement'>
            <h1 className=''>{props.type}</h1>
            <div className="ingreso-container"><img className="image-ingreso"src={'img/ingreso-egreso/ingreso.png'} width="100%" /></div>
        </div>
    )
}

export default Movement;
